import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { useGlobalContext } from './context/globalContext'; // Adjust the path accordingly
import AuthView from './components/Auth/AuthView';
import Navigation from './components/Shared/Navigation';
import Home from './components/Home/Home';
import ProtectedRoute from './components/Shared/ProtectedRoute';
import Benefits from './components/Benefits/Benefits';
import Plans from './components/Plans/Plans';
import EmployeeView from './components/Employee/EmployeeView';
import JobPosts from './components/Jobs/JobPosts';
import DashboardView from './components/Shared/Dashboard/DashboardView';
import JobDetails from './components/Jobs/JobDetail'; // Adjust the path accordingly
import Apply from './components/Jobs/Apply';
import ApplicantsView from './components/Shared/Dashboard/ApplicantsView';

const App = () => {
  return (
    <BrowserRouter>
      <header>
        <Navigation />
      </header>
      <main>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/perfil-empleado" element={<EmployeeView />} />
          <Route path="/panel-empresa/*" element={<DashboardView userType="Employee" />} />
          <Route path="/panel-empleado" element={<DashboardView userType="Restaurant" />} />
          <Route path="/beneficios" element={<Benefits />} />
          <Route path="/planes" element={<Plans />} />
          <Route path="/signin" element={<AuthView isSignUp={false} />} />
          <Route path="/signup" element={<AuthView isSignUp={true} />} />
          <Route path="/trabajos" element={<JobPosts />} />
          <Route path="/trabajos/:id" element={<JobDetails />} />
          <Route path="/postular/:id" element={<Apply />} />
          <Route path="/applicants" element={<ApplicantsView/>}/>
          <Route path="/application/:applicationId" element={<ApplicationDetail/>} />


        </Routes>
      </main>
    </BrowserRouter>
  );
};

export default App;
